  false,\n\t\"url\": null,\n\t\"notes\": \"Russian Federation Snow Depth and Ice Crust
  Surveys, dataset DSI-9808, contains routine snow surveys that run throughout the
  cold season every 10 days (every five days during the intense snowmelt) at 517 meteorological
  stations in Russia for 1966 - 2009. Snow surveys were run separately along all types
  of environment typical for the site for 1 to 2 km, (fields, forest). At each 10
  (forest) to 20 (field) meters the observer made snow depth measurements and at each
  100 to 200 meters a more comprehensive suite of measurements is made. The dataset
  is archived as a single tar file that contains a station list, a data description
  document, and the data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
